import { webPortfolio } from "../../data";

const Portfolio = () => {
  const [selected, setSelected] = useState("web apps");
  const [data, setData] = useState([]);
  const list = [
    {
      id: "web apps",
      title: "web apps",
    },
  ];

  useEffect(() => {
    switch (selected) {
      case "web apps":
        setData(webPortfolio);
        break;
      default:
    }
  }, [selected]);

  return (
    <div className="portfolio" id="portfolio">
      <h1>Portfolio</h1>

      <div className="container">
        {data.map((d) => (
          <div className="item">
            <img
              src={d.img}
              alt=""
            />
            <a href={d.href}
               target="blank"> </a>
            <h3>{d.title}</h3>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Portfolio;
